Actionscript.script:
function 旋刃攻击(击倒率)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 1.5;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 击倒率;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}
function 旋刃旋击(击倒率)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 0.2;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	子弹参数.霰弹值 = 3;
	子弹参数.子弹种类 = "近战联弹";
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 击倒率;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}
function 旋刃重击()
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 3 + _parent.刀属性.power * 2;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 1;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		//Key.isDown(_parent._parent.A键)更换为_parent._parent.动作A
		/*
		if (_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.启用 && _parent._parent.动作A && _parent._parent.动作B)
		{
			_parent._parent.状态改变("兵器跳");
		}
		*/
		if (!_parent._parent.飞行浮空 && _parent._parent.动作B)
		{
			_parent._parent.状态改变("兵器跳");
		}

	}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
